import React, { useContext } from 'react';
import { AppContext } from '../Context';


export const Movie = () => {
    const {getMovie}=useContext(AppContext);
 
    return (
        <>
       {getMovie.map((current,index)=>{
           return (
            <><div>
            <h1>{current}</h1>
           </div></>
           );
       })}
        </>
    );
}

export default Movie;
